import React from 'react';
import SwipeableViews from 'react-swipeable-views';

const BasicCarousel: React.FC = () => {
  const styles = {
    slide: {
      padding: 15,
      minHeight: 100,
      color: '#fff',
    },
  };
  return (
    <SwipeableViews enableMouseEvents>
      <div style={Object.assign({}, styles.slide)}>
        slide n°1
      </div>
      <div style={Object.assign({}, styles.slide)}>
        slide n°2
      </div>
      <div style={Object.assign({}, styles.slide)}>
        slide n°3
      </div>
    </SwipeableViews>
  );
}

export default BasicCarousel;
